const mongoose  = require('mongoose');
const crypto    = require('crypto');
const Schema    = mongoose.Schema;

mongoose.Promise = Promise; // Просим Mongoose использовать стандартные Промисы
mongoose.set('debug', true); // Просим Mongoose писать все запросы к базе в консоль
mongoose.connect('mongodb://localhost/testIm', { useMongoClient: true });
const db = mongoose.connection;

db.on('error', console.error.bind(console, 'connection error:'));
db.once('open', function() {
  // we're connected!
});

const userSchema = new Schema({
  displayName: String,
  email: {
    type: String,
    required: true,
    unique: true
  },
  passwordHash: String,
  salt: String,
});

userSchema.virtual('password')
  .set(function (password) {
    this._plainPassword = password;
    if (password) {
      this.salt = crypto.randomBytes(128).toString('base64');
      this.passwordHash = crypto.pbkdf2Sync(password, this.salt, 1, 128, 'sha1');
    } else {
      this.salt = undefined;
      this.passwordHash = undefined;
    }
  })
  .get(function () {
    return this._plainPassword;
  });

userSchema.methods.checkPassword = function (password) {
  if (!password) return false;
  if (!this.passwordHash) return false;
  return crypto.pbkdf2Sync(password, this.salt, 1, 128, 'sha1') == this.passwordHash;
};

const userModel = mongoose.model('Users', userSchema);

const user = new userModel({ displayName: 'Guest', email: 'Guest', password: 'Guest' });

user.save(function (err, user) {
  if (err) return console.error(err);
  console.log(user.displayName);
});

const imgSchema = new Schema({
  imgName: String,
  imgData: String,
});

const imgModel = mongoose.model('Images', imgSchema);

const img = new imgModel({ imgName: 'Guest', imgData: 'data:image/png;base64,' });

img.save(function (err, img) {
  if (err) return console.error(err);
  console.log(img.imgName);
});

db.close();
